import React from 'react';
import PropTypes from 'prop-types';
import classNames from 'classnames';
import { withStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import {fetchFoods} from '../../store/actions/foods';
import {connect} from 'react-redux';

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
});

class SearchBar extends React.Component {
  state = {
    searchedFood: "",
  };

  onChange = e => {
    this.setState({
      searchedFood: e.target.value
    });
    //const por las huevas que este dentro de la funcion, estoy testeando
    const { currentUserId } = this.props;
    this.props.fetchFoods(currentUserId,this.state.searchedFood, console.log(this.state.searchedFood));

  }

  onFormSubmit = event => {
    event.preventDefault();
  };

  //   onChange = (event) => {
  //   this.setState({
  //     searchedFood: event.target.value,
  //   });
  //   const { currentUserId } = this.props;
  //   const { searchedFood } = this.state
  //   this.props.fetchFoods(currentUserId, searchedFood, console.log(searchedFood));
  // };

  render() {
    const { classes } = this.props;

    return (
      <form className={classes.container} noValidate autoComplete="off" onSubmit={this.onFormSubmit}>
        <TextField
          id="standard-name"
          label=" + Alimento"
          placeholder="Agrega un alimento"
          className={classes.textField}
          onChange={this.onChange}
          margin="normal"
        />
      </form>
    );
  }
}





function mapStateToProps(state){
  return{
    foods: state.foods,
    currentUserId: state.currentUser.user.id
  };
};

export default connect(mapStateToProps, {fetchFoods})(withStyles(styles)(SearchBar))
